window.bookSummaryJSON = "<p>In the explosive conclusion to the <i>Dark Nest</i> trilogy, Luke Skywalker summons the heroes of the New Jedi Order from near and far, as the <i>Star Wars</i> galaxy teeters on the edge of eternal war. Yet even the combined powers of the formidable Jedi may not be enough to vanquish the deadly perils confronting them. </p> <p>The Chiss-Killik border war is threatening to engulf the entire galaxy and raising the awful specter of Killiks sweeping across space to absorb all living creatures into a single hive mind. The only hope for peace lies with the Jedi, who must not only end the bloodshed between two fierce enemies but also combat the insidious evil spread by the elusive Dark Nest and its unseen queen. </p> <p>Leia's newly acquired Jedi skills will be put to the ultimate test in the coming life-and-death battle. As for Luke, he will have to prove, in a lightning display of Force strength and swordplay, that he is beyond a doubt the greatest Jedi Master in the galaxy.</p>"; 
